import { Card } from 'react-bootstrap';

const Footer = () => (
    <dev style={{ position: 'absolute', left: '0', bottom: '0', right: '0' }}>
        <Card style={{ background: '#563D7C' }} variant="dark" className="text-center">
                Copyright@ 2020<span style={{ fontWeight: 'bolder', fontSize: 'larger' }}> Muhalik </span>
                - Online Shopping Website
        </Card>
    </dev>
)

export default Footer;
